import { useState } from "react";

const FormAltaProductos = (props) =>{
    const initialForm = {category: '', price: '', stocked: true, name: '', idProveedor: ''}

    const [prodcuto, setProdcuto] = useState(initialForm);

    const handleInputChange = (event) =>{
        const {name, value} = event.taget;
        setProdcuto({...prodcuto, [name]: value})
    }
    return(
        <div>
            <h1>Formulario Alta Productos</h1>
            <form>
                <input type='text' name='' value='' placeholder="Nombre"/>
                <input type='text' name='' value='' placeholder="Precio"/>
                <h4>¿Hay Stock?</h4>
                <p><input type='checkbox' name='' value=''/> Sí</p>
                <p><input type='checkbox' name='' value=''/> No</p>
                <h5>Categoria</h5>
                <select>
                    <option value='Sporting Goods'>Sporting Goods</option>
                    <option value='Electronics'>Electronics</option>
                </select>
                <h5>Proveedor</h5>
                <select>
                    <option value='1'>1</option>
                    <option value='2'>2</option>
                    <option value='3'>3</option>
                    <option value='4'>4</option>
                    <option value='5'>5</option>
                    <option value='6'>6</option>
                </select>
            </form>
        </div>
    )
}

export default FormAltaProductos;
